import React from "react";
import { Button } from "@material-ui/core";
import EditIcon from "@material-ui/icons/Edit";

const EditButton = ({ onClickFunc, style, iconStyle, textStyle, text }) => {

  return (
    <Button
      onClick={onClickFunc}
      style={{
        textTransform: "none",
        ...style
      }}
    >
      <EditIcon
        style={{
          fontSize: 14,
          ...iconStyle
        }}
      />
      &nbsp;
        <span
        style={{
          fontSize: 14,
          fontWeight: 600,
          textDecoration: "underline",
          ...textStyle,
          color: "#444851"
        }}
      >
        {text}
      </span>
    </Button>
  );
}

export { EditButton }
